import React from "react";
import Aux from "../../hoc/Aux";
import classes from "../Layout/Layout.module.css"

const layout = props => (
  <Aux>
    <div>Toolbar, sidedrawer, backdrop</div>
    <main className={classes.Content}>{props.children}</main>
  </Aux>
);

export default layout;
